import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { useSelector } from "react-redux";
function Home()
{
const a=useSelector((state)=>state.login)
return(
    <div>
    <h1>Hello Hello</h1>
    <div style={{flex:1,flexDirection:'row',justifyContent:'space-between'}}>
        <div style={{backgroundColor:'tomato',flex:1,width:'30%'}}>
            hello
        </div>
        <div style={{backgroundColor:'blue',flex:1,width:'30%'}}>
            dear
        </div>
        <div style={{backgroundColor:'greenyellow',flex:1,width:'30%'}}>
            mate
        </div>
        
    </div>
    </div>
    )
}
export default Home;
